import Command from "./Command"

function UpdateDocument (newPreviousObject,...args) {
    Command.apply(this,args);
    this._previosObject = newPreviousObject;
}

UpdateDocument.prototype.getPreviousObject = () => {
    return this._previousObject;
}

UpdateDocument.prototype.setPreviousObject = (newPreviousObject) => {
    this._previousObject = newPreviousObject;
}

UpdateDocument.prototype.execute = () => {
    this._middleware.updateDocument(this._object);
}

UpdateDocument.prototype.unexecute = () => {
    this._middleware.updateDocument(this._previousObject);
}

export default UpdateDocument;
